import { paintColors } from "../../../constants";

const Order_Paint = ({ car }) => {
  return (
    <section>
      <h2 className="title-sm">Paint</h2>
      {paintColors.map((item, index) => {
        if (car.paint.includes(index)) {
          return <div className="">{item.name}</div>;
        }
      })}
    </section>
  );
};

export default Order_Paint;
